// import NavBar from "../components/NavBar";
import { useState,setErrors } from "react";
import { Navigate, useNavigate} from "react-router-dom";
import { Formik, Field, Form, ErrorMessage } from 'formik';

function LoginForm({setUser, styles}){

  return(
  <>
    <Formik
      initialValues={{
        email: '',
        password: '',
      }}
     // validationSchema={loginSchema}
      onSubmit={(values) => {
        alert(JSON.stringify(values, null, 2))
      }}
    >
      <Form>
        <label className={styles.label} htmlFor='Email'>
          Email
        </label>
        <Field className={styles.field} id='email' name='email' />
        <ErrorMessage component='a' className={styles.errorMsg} name='email' />
        <label className={styles.label} htmlFor='Email'>
          Password
        </label>
        <Field className={styles.field} id='password' name='password' />
        <ErrorMessage
          component='a'
          className={styles.errorMsg}
          name='password'
        />
        <div className='mt-8'>
          <button type='submit' className={styles.button}>
            Login
          </button>
        </div>
      </Form>
    </Formik>
  </>
  )
    }
